               <!-- <span ng-if="vm[client].flag == \'error\'">重新打包</span> -->\n                <a class="download" ng-href="{{vm[ client ].download_url}}" ng-show="client == \'android\' && vm[ client ].flag === \'done\'">下载</a>\n            </div>\n            <!-- 打包版本号 & 下载按钮 end -->\n        </div>\n    </div>\n</div>\n'),
